import React, { Component } from 'react';

function Card(props){
  return (
      <div className= "card">
        <h2> {props.Question} </h2>
        <h4> {props.Answer} </h4>
        <h6> {props.Difficulty} </h6>
        <input/>
        <br/>
        <button className="complete"> Check Answer </button>
      </div>);


}


export default Card;
